#
# Testing with random values
#
def test3(n):
    from PySAM.PySSC import PySSC
    import PySAM.CustomGeneration as CustomGeneration

    ssc = PySSC()

    def old_no_import_rand():
        # ssc.module_exec_set_print(0)
        data = ssc.data_create()
        ssc.data_set_number(data, b'spec_mode', 0)
        ssc.data_set_number(data, b'derate', random.randint(0, 10))
        ssc.data_set_number(data, b'system_capacity', random.randint(50000, 100000))
        ssc.data_set_number(data, b'user_capacity_factor', random.randint(40, 60))
        ssc.data_set_number(data, b'heat_rate', random.randint(5, 15))
        ssc.data_set_number(data, b'conv_eff', random.randint(25, 50))
        energy_output_array = [random.random() for i in range(8760)]
        ssc.data_set_array(data, b'energy_output_array', energy_output_array)
        ssc.data_set_matrix(data, b'adjust:periods', [[random.randint(0, 4)] for i in range(3)])
        ssc.data_free(data)

    def new_no_import_rand():
        gs = CustomGeneration.new()
        a = gs.Plant
        a.spec_mode = 0
        a.derate = random.randint(0, 10)
        a.system_capacity = random.randint(50000, 100000)
        a.user_capacity_factor = random.randint(40, 50)
        a.heat_rate = random.randint(5, 15)
        a.conv_eff = random.randint(25, 50)
        a. energy_output_array = [random.random() for i in range(8760)]
        gs.AdjustmentFactors.periods = [[random.randint(0, 4)] for i in range(3)]

    # time old version
    t1 = time.process_time()
    for i in range(n):
        old_no_import_rand()

    t2 = time.process_time()

    t_old = t2 - t1

    # time new version
    t1 = time.process_time()
    for i in range(n):
        new_no_import_rand()

    t2 = time.process_time()

    t_new = t2 - t1
    if math.isclose(0, t_new, rel_tol=1e-5):
        factor = None
    else:
        factor = round(t_old / t_new, 5)
    print("Time w/o importing + rand:\t", round(t_old, 5), "\t", round(t_new, 5), "\t", factor)



#
# Testing with dictionary loading
#
def test4(n):
    import PySAM.CustomGeneration as CustomGeneration
    from PySAM.PySSC import PySSC

    dict_old = {
        'conv_eff': 34.11800003051758,
        'derate': random.randint(0, 10),
        'energy_output_array': [random.random() for i in range(8760)],
        'heat_rate': random.randint(5, 15),
        'spec_mode': 0.0,
        'system_capacity': random.randint(0, 10),
        'user_capacity_factor': random.randint(5, 15),
        'adjust:periods': [[random.randint(0, 4)] for i in range(3)]}

    dict_new = {'Plant': {
        'conv_eff': 34.11800003051758,
        'derate': random.randint(0, 10),
        'energy_output_array': [random.random() for i in range(8760)],
        'heat_rate': random.randint(5, 15),
        'spec_mode': 0.0,
        'system_capacity': random.randint(0, 10),
        'user_capacity_factor': random.randint(5, 15)},
        'AdjustmentFactors': {
            'periods': [[random.randint(0, 4)] for i in range(3)]}}

    def old_dict():

        dict_old_types = {'conv_eff': 2,
                          'derate': 2,
                          'energy_output_array': 3,
                          'heat_rate': 2,
                          'spec_mode': 2,
                          'system_capacity': 2,
                          'user_capacity_factor': 2,
                          'adjust:periods': 4}

        ssc = PySSC()
        data = ssc.data_create()
        for k, v in dict_old.items():
            type = dict_old_types[k]
            bytestr = k.encode()
            if type == 1:
                if isinstance(v, str):
                    ssc.data_set_string(data, bytestr, v)
                else:
                    raise ValueError(k, "not str")
            elif type == 2:
                if isinstance(v, float) or isinstance(v, int):
                    ssc.data_set_number(data, bytestr, v)
                else:
                    raise ValueError(k, "not float")
            elif type == 3:
                if isinstance(v, tuple) or isinstance(v, list):
                    ssc.data_set_array(data, bytestr, v)
                else:
                    raise ValueError(k, "not array")

            elif type == 2:
                if isinstance(v, collections.Sequence):
                    ssc.data_set_matrix(data, bytestr, v)
                else:
                    raise ValueError("not matrix")
        ssc.data_free(data)

    def new_dict():

        gs = CustomGeneration.new()
        gs.assign(dict_new)

    # time old version

    t1 = time.process_time()
    for i in range(n):
        old_dict()

    t2 = time.process_time()

    t_old = t2 - t1

    # time new version
    t1 = time.process_time()
    for i in range(n):
        new_dict()

    t2 = time.process_time()

    t_new = t2 - t1
    if math.isclose(0, t_new, rel_tol=1e-5):
        factor = None
    else:
        factor = round(t_old / t_new, 5)
    print("Time w/o importing w/ dict:\t", round(t_old, 5), "\t", round(t_new, 5), "\t", factor)



for n in (100, 1000):

    print("Testing over", n, "loops:\t\t t_old\t\tt_new\t\tfactor")

    test1(n)
    test2(n)
    test4(n)

    print()
